  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Moosehorn NWR
  outlines Refuge accomplishments from August through October of 1941. The report
  begins by summarizing the weather conditions during this period. Wildlife- including
  migratory birds, upland game birds, big game animals, and fish- is also covered.
  The Refuge development and maintenance section discusses wildfires. Resource management
  is outlined; topics include timber removal. The public relations section of the
  report describes violations. Photographs are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
